import React from 'react';
import {Link} from 'react-router-dom'

const RestaurantList = (props) => {


    const renderList = ({restdata}) => {
        if(restdata){
            return restdata.map((item) => {
                return (
                    <tr>
                        <td><Link to={`/rest/${item._id}`}>{item.name}</Link></td>
                        <td>{item.locality}</td>
                        <td>{item.Cuisine[0].name},{item.Cuisine[1].name}</td>
                        <td>{item.type[0].name},{item.type[1].name}</td>
                        <td>{item.cost}</td>
                    </tr>
                    // <div>
                    //     <div className="image">
                    //         </div>
                    //         <div className="address">
                    //             <h2><Link to={`/rest/${item._id}`}>{item.name}</Link></h2><br />
                    //             <h3>Port</h3><br />
                    //             <p>{item.locality}</p>
                    //         </div>
                    //         <hr />
                    //     <div className="price">
                    //             <p>Mealtype : {item.type[0].name},{item.type[1].name}</p> 
                    //             <p>CUISINES : {item.Cuisine[0].name},{item.Cuisine[1].name}</p>
                    //             <p>COST FOR TWO:₹{item.cost}</p>
                    //     </div>
                    // </div>
                )
            })
        }
    }
    return(
        <div className="container">
                <center><h3>Restaurants List</h3></center>
            <table className="table table-responsive">
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Locality</th>
                        <th>Cuisine</th>
                        <th>Meal</th>
                        <th>Cost</th>
                    </tr>
                </thead>
                <tbody>
                {renderList(props)}
                </tbody>
                
            </table>    
        </div>
    )
}

export default RestaurantList;
